import React, { useState } from 'react'
import Projects from '../components/Projects'
import Skills from '../components/Skills'

const Page = (props) => {

    const [show, setShow] = useState(0)

    const changeShow = (num) => {
        setShow(num)
      }

  return (
    <>
    {show === 2 ? <Skills setPage={setPage}/> : null}
    {show === 3 ? <Projects setPage={setPage}/> : null}
    <div className='Page-buttons'>
        <button onClick={() => changeShow(0)}>Skills</button>
        <button onClick={() => changeShow(1)}>Projects</button>
    </div>
    </>
  )
}

export default Page
